	(58,'石山水代金券 仅售80元！价值100元的代金券1张，全场通用，可叠加使用，提供免费WiFi。','石山水代金券',8,28,'./public/attachment/201502/25/15/54ed765bb0d9b.jpg','<p>石山水美式餐厅是隶属于双福集团旗下的一个全球连锁餐饮品牌，源自于1909年美国加利福尼亚州落杉矶西部小镇的一个阳光乡村牛排馆。他们以连锁经营为拓展模式，从自1998年福州五一广场双福楼门店开业以来，在新老客户的支持下，石山水美式餐厅已在福州繁华的各大商圈拥有六家直营连锁店，同时在宁德、泉州晋江和江苏盐城等相继开出连锁加盟店。秉着铸造美式西餐行业品牌的宏伟目标，石山水坚持将美式西餐的概念融入东方餐饮文化，在东西方的融合中，形成了崭新的适合中国人的西餐，开辟出一片新的天地。&nbsp;</p>\r\n<p><br />\r\n</p>\r\n<p align=\"center\"><img src=\"./public/attachment/201502/25/15/54ed773aeab64.jpg\" alt=\"\" border=\"0\" /><br />\r\n</p>\r\n',1422746309,1582240711,0,5000,0,0,100.0000,80.0000,15,1,0,1,0,0,0,1,1,0,0,0.0000,5,'仅售80元！价值100元的代金券1张，全场通用，可叠加使用，提供免费WiFi。',2,0,1424819941,1,7,0,0,'',0.0000,0,0,0,0.0000,'./public/attachment/201502/25/15/54ed765bb0d9b.jpg',0,0,0,'','','',0,0,0,0,0,'shiss',0,0,0,0,0,0.0000,1424819941,1424829820,'ux20195ux37329ux21048,ux21472ux21152,ux20165ux21806,ux20840ux22330,ux23665ux27700,ux36890ux29992,ux20215ux20540,ux20351ux29992,ux25552ux20379,ux20813ux36153,ux30707ux23665ux27700ux20195ux37329ux21048ux20165ux21806ux56ux48ux20803ux65281ux20215ux20540ux49ux48ux48ux20803ux30340ux20195ux37329ux21048ux49ux24352ux65292ux20840ux22330ux36890ux29992ux65292ux21487ux21472ux21152ux20351ux29992ux65292ux25552ux20379ux20813ux36153ux87ux105ux70ux105ux12290','代金券,叠加,仅售,全场,山水,通用,价值,使用,提供,免费,石山水代金券 仅售80元！价值100元的代金券1张，全场通用，可叠加使用，提供免费WiFi。','ux39184ux39278ux32654ux39135,ux21654ux21857','餐饮美食,咖啡','','','ux31119ux24314,ux31119ux24030,ux40723ux27004ux21306,ux19996ux34903,ux24433ux22478,ux28023ux23777,ux22823ux21414,ux27004ux65288,ux40723ux27004ux21306ux19996ux34903ux49ux52ux21495ux38397ux36745ux22823ux21414ux49ux27004ux65288ux36817ux28023ux23777ux24433ux22478ux65289,ux20116ux19968ux24191ux22330,ux19996ux34903ux21475','福建,福州,鼓楼区,东街,影城,海峡,大厦,楼（,鼓楼区东街14号闽辉大厦1楼（近海峡影城）,五一广场,东街口','','','119.307134','26.092442',0,0,0,0,1,50.0000,0,0,0,0,0,16,0,'',0,0,0,0,0),
