	(61,'仅售128元！最高价值392元的贵安温泉休闲一日游套餐，山水怡情，温泉怡身，季节在变，温泉给你的温暖不变','贵安温泉',11,30,'./public/attachment/201502/25/15/54ed7dcce36b1.jpg','<p align=\"center\"><img border=\"0\" alt=\"\" src=\"./public/attachment/201502/25/15/54ed7dcce36b1.jpg\" /></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<ul id=\"yui_3_16_0_1_1424850233122_1924\" class=\"list\" style=\"white-space:normal;word-spacing:0px;text-transform:none;color:#666666;padding-bottom:0px;padding-top:0px;font:14px/21px \'hiragino sans gb\', \'wenquanyi micro hei\', tahoma, sans-serif;padding-left:18px;margin:10px 0px 15px;letter-spacing:normal;padding-right:0px;background-color:#ffffff;text-indent:0px;-webkit-text-stroke-width:0px;\"><li id=\"yui_3_16_0_1_1424850233122_1923\" style=\"list-style-type:disc;list-style-position:outside;padding-bottom:0px;padding-top:0px;padding-left:0px;margin:0px 0px 5px;padding-right:0px;\"><b>浸香</b><br />\r\n<p style=\"color:#666666;padding-bottom:0px;padding-top:0px;font:14px/24px \'hiragino sans gb\', \'wenquanyi micro hei\', tahoma, sans-serif;padding-left:0px;margin:10px 0px;padding-right:0px;\">泡温泉是个慢功夫，浸水也要慢。先用温水淋洗暖身，然后慢慢浸入池中，待泉水到达胸口处时停住，静待3~5分钟，等身体全部暖和起来之后，再泡到肩膀处。浸泡过程中，可尽量呼吸泉水蒸汽（硫磺泉不适用），搭配水果或玫瑰花茶，边喝边泡，让泉水和茶香内外交融渗透，滋养肌肤。</p>\r\n</li>\r\n<li style=\"list-style-type:disc;list-style-position:outside;padding-bottom:0px;padding-top:0px;padding-left:0px;margin:0px 0px 5px;padding-right:0px;\"><b>敷面</b><br />\r\n<p style=\"color:#666666;padding-bottom:0px;padding-top:0px;font:14px/24px \'hiragino sans gb\', \'wenquanyi micro hei\', tahoma, sans-serif;padding-left:0px;margin:10px 0px;padding-right:0px;\">泡温泉时是护肤的最佳时间，这时的皮肤受热，毛孔张开，最利于养分的吸收，因此泡温泉时携带面膜敷面，可达到事半功倍的美肤效果。面膜功效最好为保湿型，因美白型面膜含酸性成分，使用后可能会造成皮肤泛红。</p>\r\n</li>\r\n<li id=\"yui_3_16_0_1_1424850233122_1930\" style=\"list-style-type:disc;list-style-position:outside;padding-bottom:0px;padding-top:0px;padding-left:0px;margin:0px 0px 5px;padding-right:0px;\"><b>清洁</b><br />\r\n<p id=\"yui_3_16_0_1_1424850233122_1929\" style=\"color:#666666;padding-bo